import React from 'react';
import HeaderDropdown from '../HeaderDropdown/HeaderDropdown'

function HeaderNavbar() {

    const headerNavbar = [
        {
            title: 'Портфолио',
            link: '/'
        },
        {
            title: 'Контакты',
            link: '/'
        },
        {
            title: 'Цены',
            link: '/'
        }
    ]
        return (
        <ul className='header__navbar'>
            <HeaderDropdown/>
            {
                headerNavbar.map(i => (
                    <a class="header__navbar-item" href="/">Портфолио</a>
                ))
            }
        </ul>
    )
}

export default HeaderNavbar;
